description:
Er is geen chocoladeletter meer te krijgen voor Sint en Piet in Sesamstraat, omdat meneer Aart alle letters heeft opgekocht. Hij wist niet dat deze letters bestemd waren voor Sinterklaas, die ze weg wilde geven aan iedereen in Sesamstraat en besluit daarom een brief te schrijven aan Sinterklaas. Hierin schrijft hij dat Sinterklaas niet naar Sesamstraat hoeft te komen, omdat de kinderen bang voor hem zijn. Wel vraagt hij of Zwarte Piet de kado&amp;#039;s af kan komen geven zonder dat iemand hem ziet. Niemand in Sesamstraat begrijpt waarom Sint en Piet niet komen, totdat Pino, Tommie en Ieniemienie iets ontdekken.....
